function Dashboard() {
  const [searchParams, setSearchParams] = useSearchParams();

  const userCode = searchParams.get("code");
  var authSuccess = false;

  const navigate = useNavigate();

  // Accessing query parameters
  const queryParams = new URLSearchParams(window.location.search);
  const param1 = queryParams.get("param1");

  // Example: Navigating with query parameters
  const navigateWithParams = () => {
    // Use navigate to go to a new URL with query parameters
    navigate(`/dashboard?param1=value1&param2=value2`);
  };

  fetch("http://localhost:3232/api/get-user-code?code=" + userCode)
    .then((result) => {
      console.log(result);
      result.json();
    })
    .then((json) => {
      authSuccess = json["result"] == "success";
    });

